window.bookSummaryJSON = "<p>\"You never have to be without me, Laney, never.\" He lied...my everything I ever knew, trusted, wanted...I am, in fact, without him. On my own and out of my shell, I learn new things about life, friendship and...myself. Like what you've always known may not be what you've always wanted. </p><p>Dane Kendrick awakened things within me that I never knew existed, unraveling and uncovering the real Laney Jo Walker. I'm a <i>new</i> adult...so is my story. </p>"; 
